import React, {useState} from "react"

function MultiselectD(){
    const options = [
        { label: "Grapes üçá", value: "grapes" },
        { label: "Mango ü•≠", value: "mango" },
        { label: "Strawberry üçì", value: "strawberry" },
        { label: "Watermelon üçâ", value: "watermelon" },
        { label: "Pear üçê", value: "pear" },
        { label: "Apple üçé", value: "apple" },
        { label: "Tangerine üçä", value: "tangerine" },
        { label: "Pineapple üçç", value: "pineapple" },
        { label: "Peach üçë", value: "peach" }
      ];

      const [selected, setSelected] = useState([]);

      return (
        <div>
            {/* <h1>Select Fruits</h1> */}
            {/* <pre class="flex-auto">{JSON.stringify(selected)}</pre> */}
            <div class="my-3 w-2/3 justify-center self-center bg-gray-50 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-45 p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500 w-72">
                <MultiSelect class="self-center"
                    options={options}
                    value={selected}
                    onChange={setSelected}
                    labelledBy={"Select"}
                    isCreatable={true}
                />
            </div>
        </div>
      )

}

export default MultiselectD;
